import {
  BrowserRouter as Router,
  Route,
  Switch as RouterSwitch,
} from "react-router-dom";
import NavBar from "./Components/Navbar";
import Home from "./Components/Home";
import Footer from "./Components/Footer";

const App = () => {
  return (
    <>
      <Router>
        <div className="App">
          <NavBar />
          <RouterSwitch>
            <Route exact path="/">
              <Home />
            </Route>
          </RouterSwitch>
          <Footer />
        </div>
      </Router>
    </>
  );
};

export default App;
